import React, { Component } from 'react';
import { logout } from '../redux/actions';

class Profile extends Component {

  render() {
    return (
      <div className="main-container">
        <div
          className="standard-button"
          onClick={this.logout}
        >
          Logout
        </div>
      </div>
    )
  }
}

export default Profile;
